import React, { Component } from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";
import { withRouter } from 'react-router-dom';

// For the bits that make scrolling work as expected.
import { ScrollContext } from 'react-router-scroll-4';

// This contains the SVG spritesheet
import SVGSpritesheet from './resources/_svg-spritesheet.js';



// The pages components by the router
import Home       from './components/home'
import Details    from './components/details'
import HeaderBar  from './components/header-bar'

class App extends Component {
    render() {
        return (
            <BrowserRouter path={process.env.PUBLIC_URL + '/'}>
                <ScrollContext>
                    <div className="App">
                        <HeaderBar />

                        <Route path="/" exact component={Home} />
                        <Route path="/details/:license/:prettyname" component={withRouter(Details)} />

                        <Link to={'#'}>Just a link to shut the compiler up.</Link>
                        <SVGSpritesheet />
                    </div>
                </ScrollContext>
            </BrowserRouter>

        );
    }
}

export default App;
